            "_id": 113053,
            "R": 4,
            "Name": "Cuerno de corcel fontamarino",
            "Desc": "Como depredador superior que creció a partir de un Caballito Burbumarino, el proceso evolutivo del Corcel de Mar Perlamilenario es completamente distinto al de otros Engendros Fontamarinos: no evolucionó para hacerse más grande y fuerte basándose en la estructura original de la especie, sino que desarrolló extremidades, un cuerno e incluso cambios en su estructura ósea y muscular que no estaban presentes en los Caballitos Burbumarinos. Su forma se parece más a la de una bestia fantástica de una antigua leyenda que a la original. En las fantasías de poetas y dramaturgos, incluso un caballito de mar podría ser como un unicornio galopando y saltando sobre la superficie terrestre.<br>Según las leyendas de Fontaine, existen dos reyes Engendros Fontamarinos que siempre han rivalizado entre sí. Uno de los tiranos superó con creces a todos sus pares, estableciendo finalmente su propio reinado solitario en una cueva de la que solo él era dueño.",
