            "R": 4,
            "Name": "Recambio mecánico de Coppélia",
            "Desc": "Una pieza de recambio perteneciente a Coppélia y que sirve como fuente de energía para esta bailarina mecánica.<br>Para su creador, la historia de esta bailarina de juntas finas reposa en un momento feliz, y Coppélia utilizará sus extraordinarias habilidades de combate para enviar al capítulo de la tragedia a cualquier invitado indeseado que perturbe dicho momento.<br>«Suite Criocéfiro» es una canción inspirada en la obra «Coppélia, la dama mecánica», cuyos actos previos se representaron una única vez en el teatro y los cuales se narra la historia de Coppélia, una Mecabot con sentimientos de quien su inventor se enamoró. La obra fue muy esperada por los críticos y el mundo de las artes antes de su puesta en escena, pero durante el entreacto de la primera representación ocurrió una catástrofe que marcó profundamente al mundo entero.<br>Todo lo que queda de su historia son algunas líneas de diálogo del primer acto, reconstruidas a partir de los espectadores que tuvieron la suerte de asistir al teatro en aquel entonces, así como los escombros y anuncios que quedaron en revistas obsoletas.<br>Esto aconteció hace muchos años, antes de que comenzaran a construir la Ópera de la Epíclesis. De hecho, nadie compró ni reconstruyó aquel teatro después de que se destruyera y, tras numerosos cambios de propietario, se convirtió en el actual Bistró Debord. Muchos años después, «Coppélia, la dama mecánica», una obra nunca terminada, sigue inspirando a creadores, ingenieros e inventores apasionados por la literatura y el arte, deseosos de representar aquella edad de oro o aquella tragedia —dos elementos que aparecen a menudo entrelazados en una misma historia.",
