            "R": 4,
            "Name": "Movimiento de serenata arcaica",
            "Desc": "Material de ascensión de arma.<br>La serenata se fragmentó y las notas musicales se silenciaron durante la catástrofe en la que palacios de oro y tronos reales quedaron sumergidos bajo el agua.<br>Sin embargo, la gente del imperio nunca renunció a su esperanza de poder salvar y trascender a su destino.<br>A fin de salvar una civilización en decadencia y unos sueños trascendentales, la Compañía Dorada interpretó una bella sinfonía con la que guio a los niños para que ofrecieran sus nobles almas a los gólems durmientes.",
