            "Desc": "Material de ascensión de arma.<br>Una pieza oxidada de arpa cuyo tubo por el que sale la música está obstruido, así que ya no sirve para tocar.<br>Dicen que, para restaurar la magnificencia de la antigua dinastía, los descendientes de la serenata olvidada revistieron de oro unas arpas mecánicas de madera en un inútil intento de dárselo a unos gólems taciturnos.<br>Mucho tiempo después, esas arpas, ahora oxidadas y desafinadas, siguen en las manos de aquellas gigantescas estatuas silenciosas mientras acarician el mar con el melancólico eco de su música.",
