            "R": 1,
            "Name": "Rosarcoíris",
            "Desc": "Una delicada planta de color rosado. A pesar de lo que su nombre indica, este tipo de planta se parece más a los lirios.<br>Según la simbología de las flores, representa cordialidad y un encuentro maravilloso. Según antiguos registros, esta flor podía hallarse en cualquier parte del mundo. Sus vívidos colores podían competir con las llamas de los siete cielos. Hoy en día, esta flor se encuentra extinguida y, con el final de una era caótica, el nombre de rosarcoíris terminó adoptándolo una flor que crecía de forma simbiótica con ella.",
