            "R": 1,
            "Name": "Campanilla lumidulce",
            "Desc": "Una preciosa y apacible planta de color lavanda. Posee una fragancia duradera y suave, por lo que es perfecta para fabricar particulares perfumes.<br>Esta flor simboliza una despedida y el deseo de reencuentro.<br>En la famosa obra de Coppélius «Dorada Hiperbórea», se hace referencia a la flor como “llanto cristalino” para describir a una flor nostálgica que deambulaba por las tierras gélidas del norte y cuya belleza se eternizó gracias a los vientos helados. En tiempos de Coppélius, la crítica opinó que estaba obsesionado con la belleza y amor eterno, obsesión la cual se refleja en su última obra.",
